import React from 'react';
import { NavLink } from 'react-router-dom';
import * as faIcon from 'react-icons/fa';

const Navbar = () => {
    return (<>
        <div className="navbar">
            <NavLink to="#">
                <faIcon.FaBars />
            </NavLink>
        </div>
        <nav className={sideBar ? 'nav-menu active' : 'nav-menu'}>
            li
        </nav>
    </>);
}

export default Navbar;
